import React from 'react';
import '../styles/termo.css';

export default function Termo() {
 return (
   <div className="paget">
     <div className="cardt">
         <h1>O Projeto Visão Social conta com o aulixio do Governo do Distrito Federal.</h1><br/>
       </div>     
     <div className="ps10">

       <div className="termo">
         <p>Termo de fomento(MROSC) Nº 26/2019 (75214713), firmado em 23/10/2019, entre o Distrito Federal/Secretaria de Estado de Justiça e Cidadania/Fundos dos direitos da criança e do adolescente - DF e a instituição Visão Social, inscrita no CNPJ/DF sob o número 08.849.463/0001-80. Nessa parceria não contamos o apoio para alimentação e gás de cozinha, materiais de limpeza e higênie, contas de água, luz, internet.Precisamos do seu apoio!</p>
       </div>
     </div>
   </div>
 );
}
